import './App.css';
import Axios from 'axios';
import * as ReactBootStrap from 'react-bootstrap';
class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      count: 0,
      players : [
        {position: "hdf", name: "jland", team: "a,msn"},
        {position: "skjdn", name: "asd", team: "mnb"},
        {position: "nmbc", name: "nsab", team: "ndbkj"},
        {position: "lkajd", name: "jhj", team: "jaHDL"},
        {position: "mxncv,m", name: "jsahd", team: "LKASHD"},
      ]
    };
  }

  renderPlayer = (player,index) => {
    return(
      <tr key = {index}>
        <td>{player.position}</td>
        <td>{player.name}</td>
        <td>{player.team}</td>
      </tr>
    )
  }
  render() {
    return (
      <div className="App">
      <button>Fetch</button>
      <ReactBootStrap.Table striped bordered hover variant="dark">
  <thead>
    <tr>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
    {this.players.map(this.renderPlayer)}
  </tbody>
</ReactBootStrap.Table>
    </div>
    );
  }
}
